  return (
    <div className="container">
      <div className="row">
        <div className="col">Account Opening</div>
        <div className="col"> Your Zerodha Account</div>{" "}
        <div className="col">Your Zerodha Account</div>
      </div>
    </div>
  );
}

export default CreateTicket;
